import{_ as t,o as r,c as a,z as e,a as o}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 2.2-2362 Moneys of Authority; examination of books by the Auditor of Public Accounts.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/2.2-2362.md","filePath":"vacode/2.2-2362.md"}'),i={name:"vacode/2.2-2362.md"},s=e("h1",{id:"§-2-2-2362-moneys-of-authority-examination-of-books-by-the-auditor-of-public-accounts",tabindex:"-1"},[o("§ 2.2-2362 Moneys of Authority; examination of books by the Auditor of Public Accounts. "),e("a",{class:"header-anchor",href:"#§-2-2-2362-moneys-of-authority-examination-of-books-by-the-auditor-of-public-accounts","aria-label":'Permalink to "§ 2.2-2362 Moneys of Authority; examination of books by the Auditor of Public Accounts."'},"​")],-1),n=e("p",null,"All moneys of the Authority, from whatever source derived, shall be paid to the treasurer of the Authority. Such moneys shall be deposited in the first instance by the treasurer in one or more banks or trust companies, in one or more special accounts. All banks and trust companies are authorized to give such security for such deposits, if required by the Authority. The moneys in such accounts shall be paid out on the warrant or other order of the treasurer of the Authority or of other persons as the Authority may authorize to execute such warrants or orders. The Auditor of Public Accounts or his legally authorized representatives shall examine the accounts and books of the Authority.",-1),c=e("p",null,[o("2020, cc. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1164",target:"_blank",rel:"noreferrer"},"1164"),o(", "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1169",target:"_blank",rel:"noreferrer"},"1169"),o(".")],-1),h=[s,n,c];function u(l,d,f,b,y,p){return r(),a("div",null,h)}const A=t(i,[["render",u]]);export{_ as __pageData,A as default};
